import { Injectable } from '@nestjs/common';

@Injectable()
export class RealtyService {
  realtyList(): Array<any> {
    const res = alasql(
      'SELECT address, cadastralNumber, prevCadastralNumber  FROM ? ORDER BY address ',
      [Realty]
    ); 
    return res;
  }
  /**
   * 
   */
  houseApartmentsList(): Array<any> {
    alasql.fn.linkOpen = function(guid){
      return 'https://my.dom.gosuslugi.ru/organization-cabinet/#!/apartment?guid='+guid;
    }
    const res=alasql(
      'SELECT guid ,flatNumber,cadastreNumber, rosreestrRootGuid , linkOpen(guid) as openLink FROM ? WHERE cadastreNumber is NULL ORDER BY flatNumber ',
      [AppartmentList]
    ); 
    return res;
  }
}
